begin
  wwv_flow_api.create_sw_sql_cmds (
    p_id => 39751376938735987289
 ,p_command => 
'create or update procedure sv_page_process'||wwv_flow.LF||
'is '||wwv_flow.LF||
'    l_app_id :apex_application.G_FLOW_ID;'||wwv_flow.LF||
'    l_p_id := apex_application.G_FLOW_STEP_ID;'||wwv_flow.LF||
'    p VARCHAR2(10) := ''P'' || l_p_id;'||wwv_flow.LF||
'    l_qu_id := sv_response_values.qu_id%TYPE;'||wwv_flow.LF||
'    l_rs_id sv_responses.rs_id%TYPE;'||wwv_flow.LF||
'    p_item sv_response_values.q_value%TYPE;'||wwv_flow.LF||
''||wwv_flow.LF||
'    cursor c_item_ids is'||wwv_flow.LF||
'        SELECT substr(Item_Name,5) Item_Id'||wwv_flow.LF||
'        FROM APEX_APPLICATION_P'||
'AGE_ITEMS'||wwv_flow.LF||
'        WHERE APPLICATION_ID = :l_app_id;'||wwv_flow.LF||
'	        and PAGE_ID = :l_p_id'||wwv_flow.LF||
'	        and ITEM_NAME like p || ''_Q%'';'||wwv_flow.LF||
'        ORDER BY DISPLAY_SEQUENCE;'||wwv_flow.LF||
''||wwv_flow.LF||
'begin'||wwv_flow.LF||
'    -- insert row into sv_responses.  return the new rv_id value'||wwv_flow.LF||
'	INSERT INTO sv_responses (created_on) VALUES (SYSDATE)'||wwv_flow.LF||
'		RETURNING rs_id into l_rs_id;'||wwv_flow.LF||
''||wwv_flow.LF||
'    open c_item_ids;'||wwv_flow.LF||
'    loop'||wwv_flow.LF||
'        fetch c_item_ids into l_qu_id;'||wwv_flow.LF||
'        exit'||
' when (c_item_ids%NOTFOUND);'||wwv_flow.LF||
'        p_item := p || ''_Q%'' || l_qu_id;'||wwv_flow.LF||
'        INSERT INTO sv_response_values (rs_id,qu_id,q_value) VALUES (l_rs_id,l_qu_id,v(p_item));'||wwv_flow.LF||
'    end loop;'||wwv_flow.LF||
'    close c_item_ids;'||wwv_flow.LF||
'end;'
    ,p_created_by => 'AVIATRISS@GMAIL.COM'
    ,p_created_on => to_date('201712110455','YYYYMMDDHH24MI')
    ,p_parsed_schema => 'AV_ADMIN');
end;
/
