 ,p_command => 
'create or replace trigger sv_questions_trg'||wwv_flow.LF||
'for insert or update or delete on sv_questions'||wwv_flow.LF||
'compound trigger'||wwv_flow.LF||
'--DECLARE'||wwv_flow.LF||
''||wwv_flow.LF||
