'BEGIN'||wwv_flow.LF||
'  case'||wwv_flow.LF||
'    when inserting then'||wwv_flow.LF||
'        if :new.is_active = 1 then'||wwv_flow.LF||
'           :new.start_date := SYSDATE;'||wwv_flow.LF||
'        end if; '||wwv_flow.LF||
'        :new.created_on := SYSDATE;'||wwv_flow.LF||
'        :new.created_by := v(''app_user'');'||wwv_flow.LF||
''||wwv_flow.LF||
'    when updating then'||wwv_flow.LF||
'        if :new.IS_ACTIVE = 0 and'||
' :old.Is_active = 1 then'||wwv_flow.LF||
'            :new.end_date := sysdate;'||wwv_flow.LF||
'        elsif :new.IS_ACTIVE = 1 and :old.Is_active = 0 then'||wwv_flow.LF||
'            :new.end_date := null;'||wwv_flow.LF||
'        end if;'||wwv_flow.LF||
'        :new.updated_on := sysdate;'||wwv_flow.LF||
'        :new.updated_by := v(''app_user'');'||wwv_flow.LF||
''||wwv_flow.LF||
