'            ,:old.end_date'||wwv_flow.LF||
'            ,:old.is_active'||wwv_flow.LF||
'            ,:old.IS_REPORTABLE'||wwv_flow.LF||
'            ,v(''app_user'')'||wwv_flow.LF||
'        '||
'    ,sysdate            '||wwv_flow.LF||
'        );'||wwv_flow.LF||
'    end case;'||wwv_flow.LF||
'END BEFORE EACH ROW;'||wwv_flow.LF||
''||wwv_flow.LF||
'AFTER EACH ROW IS'||wwv_flow.LF||
'BEGIN'||wwv_flow.LF||
