begin
  wwv_flow_api.create_sw_sql_cmds (
    p_id => 41542198186475405481
 ,p_command => 
'CREATE OR REPLACE PACKAGE sv_pkg AUTHID DEFINER AS'||wwv_flow.LF||
''||wwv_flow.LF||
'  FUNCTION sv_item_label (p_item_name VARCHAR2) RETURN VARCHAR2;		'||wwv_flow.LF||
'  PROCEDURE sv_page_process;'||wwv_flow.LF||
''||wwv_flow.LF||
'END sv_pkg;'||wwv_flow.LF||
'/'||wwv_flow.LF||
''||wwv_flow.LF||
'CREATE PACKAGE BODY sv_pkg AS'||wwv_flow.LF||
''||wwv_flow.LF||
'FUNCTION sv_item_label (p_item_name VARCHAR2) RETURN VARCHAR2'||wwv_flow.LF||
'  IS'||wwv_flow.LF||
'    v_item_label sv_questions.q_text%type;'||wwv_flow.LF||
'    l_item_num number;'||wwv_flow.LF||
'  '||wwv_flow.LF||
'  BEGIN'||wwv_flow.LF||
'    -- Get QU_ID to use from the page item''s label'||wwv_flow.LF||
'    l_item'||
'_num := instr(p_item_name,''Q'') + 1;'||wwv_flow.LF||
'  '||wwv_flow.LF||
'    SELECT Q_TEXT'||wwv_flow.LF||
'    INTO v_item_label'||wwv_flow.LF||
'    FROM SV_QUESTIONS'||wwv_flow.LF||
'    WHERE qu_id = substr(p_item_name, l_item_num);'||wwv_flow.LF||
'    RETURN v_item_label;'||wwv_flow.LF||
'  '||wwv_flow.LF||
'  EXCEPTION'||wwv_flow.LF||
'    WHEN NO_DATA_FOUND THEN'||wwv_flow.LF||
'    v_item_label := p_item_name;'||wwv_flow.LF||
'	'||wwv_flow.LF||
'  RETURN v_item_label;'||wwv_flow.LF||
'END sv_item_label;'||wwv_flow.LF||
''||wwv_flow.LF||
''||wwv_flow.LF||
'PROCEDURE sv_page_process'||wwv_flow.LF||
'  IS'||wwv_flow.LF||
'    p VARCHAR2(10) := ''P'' || v(''APP_PAGE_ID'');'||wwv_flow.LF||
'    l_qu_id sv_response'||
'_values.qu_id%TYPE;'||wwv_flow.LF||
'    l_rs_id sv_responses.rs_id%TYPE;'||wwv_flow.LF||
'    p_item sv_response_values.q_value%TYPE;'||wwv_flow.LF||
'    l_item_num number := lengt(p || ''_Q'') + 1;'||wwv_flow.LF||
'  '||wwv_flow.LF||
'    cursor c_item_ids is'||wwv_flow.LF||
'      SELECT substr(Item_Name,l_item_num) Item_Id'||wwv_flow.LF||
'      FROM APEX_APPLICATION_PAGE_ITEMS'||wwv_flow.LF||
'      WHERE APPLICATION_ID = v(''APP_ID'')'||wwv_flow.LF||
'        and PAGE_ID = v(''APP_PAGE_ID'')'||wwv_flow.LF||
'        and ITEM_NAME like p || ''_Q%'''||wwv_flow.LF||
'      ORDER BY DI'||
'SPLAY_SEQUENCE;'||wwv_flow.LF||
'  '||wwv_flow.LF||
'  BEGIN'||wwv_flow.LF||
'    INSERT INTO sv_responses (CREATED_ON) VALUES (SYSDATE)'||wwv_flow.LF||
'    RETURNING rs_id INTO l_rs_id;  '||wwv_flow.LF||
'    '||wwv_flow.LF||
'    OPEN c_item_ids;'||wwv_flow.LF||
'    LOOP'||wwv_flow.LF||
'      FETCH c_item_ids INTO l_qu_id;'||wwv_flow.LF||
'      EXIT WHEN (c_item_ids%NOTFOUND);'||wwv_flow.LF||
'      p_item := v(p || ''_Q'' || l_qu_id);'||wwv_flow.LF||
'      INSERT INTO sv_response_values (rs_id,qu_id,q_value) VALUES (l_rs_id,l_qu_id,p_item);'||wwv_flow.LF||
'    END LOOP;'||wwv_flow.LF||
'    CLOSE c_item_ids'||
';'||wwv_flow.LF||
'END sv_page_process;'||wwv_flow.LF||
''||wwv_flow.LF||
'END sv_pkg;'||wwv_flow.LF||
'/'
    ,p_created_by => 'AVIATRISS@GMAIL.COM'
    ,p_created_on => to_date('201712260424','YYYYMMDDHH24MI')
    ,p_parsed_schema => 'AV_ADMIN');
end;
/
