,p_priority=>0
,p_etag_type=>'HASH'
);
wwv_flow_api.create_restful_handler(
 p_id=>wwv_flow_api.id(23116343820172108708)
,p_template_id=>wwv_flow_api.id(23116274286052050532)
,p_source_type=>'PLSQL'
,p_format=>'DEFAULT'
,p_method=>'GET'
,p_require_https=>'NO'
,p_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'  prevdeptno     number;  ',
'  total_rows     number;',
'  deptloc        varchar2(20);',
'  deptname       varchar2(20);',
'  ',
'  CURSOR         getemps is select * from emp',
'                            start with ename = :empname',
'                            connect by prior empno = mgr',
'                            order siblings by deptno, ename;',
'BEGIN',
'  sys.htp.htmlopen;',
'  sys.htp.headopen;',
'  sys.htp.title(''Hierarchical Department Report for Employee ''||:empname);',
'  sys.htp.headclose;',
'  sys.htp.bodyopen;',
' ',
'  for emprecs in getemps',
'  loop',
' ',
'      if emprecs.deptno != prevdeptno or prevdeptno is null then',
'          select dname, loc',
'          into deptname, deptloc',
'          from dept',
'          where deptno = emprecs.deptno;',
'',
'         if prevdeptno is not null then',
'             sys.htp.print(''</ul>'');',
'         end if; ',
'        sys.htp.print(''Department '' || apex_escape.html(deptname) || '' located in '' || apex_escape.html(deptloc) || ''<p/>'');',
'        sys.htp.print(''<ul>'');',
'      end if;',
' ',
'      sys.htp.print(''<li>'' || apex_escape.html(emprecs.ename) || '', ''  || apex_escape.html(emprecs.empno) || '', '' ||',
'                        apex_escape.html(emprecs.job) || '', '' || apex_escape.html(emprecs.sal) || ''</li>''); ',
'',
'      prevdeptno := emprecs.deptno;',
'      total_rows := getemps%ROWCOUNT;',
'',
'   end loop; ',
'   if total_rows > 0 then',
'       sys.htp.print(''</ul>'');',
'   end if; ',
'   sys.htp.bodyclose;',
'   sys.htp.htmlclose;',
'END;'))
);
end;
